import React from 'react';


const History = ({ user }) => {

    const historyarr = () => {
    fetch(`http://localhost:3000/history`, {
        method: 'POST',
        headers: {'Content-Type': 'application/json'},
        body: JSON.stringify({
            id: user.id
        })
    })
    .then(response => response.json())
    .then(puncharray =>{
            return(
                puncharray.map((item, index) => {
                    return(
                    <p key={index}>{item}</p>
                    )
                })
            )
    })
    .catch(err => console.log(err));
}


    return(
        <div>
            <p>hi</p>
            <div>{historyarr()}</div>
        </div>
    )
}

export default History;
